<h1 id="o-que-%C3%A9-um-sistema-de-controle-de-vers%C3%A3o---vcs">O que  um Sistema de Controle de Verso - VCS?</h1>
<ul>
<li>Sistema que registra alteraes em um arquivo ou conjunto de arquivos ao longo do tempo.</li>
<li>Arquivos de texto: cdigo-fonte, documentos, etc.</li>
<li>Arquivos binrios: imagens, vdeos, etc.</li>
</ul>

<h1 id="por-qu%C3%AA-utilizar-um-sistema-de-controle-de-vers%C3%A3o-1">Por Qu Utilizar um Sistema de Controle de Verso?</h1>
<ol>
<li>Organizao e Histrico de Alteraes</li>
<li>Rastrear alteraes em arquivos.</li>
<li>Garantir a recuperao de verses anteriores.</li>
<li>Facilitar a colaborao entre pessoas.</li>

<header>Git e GitHub</header>
<h1 id="o-que-%C3%A9-git">O que  Git?</h1>
<ul>
<li>Git  um sistema de controle de verso distribudo.</li>
<li>Ele foi inicialmente pensado para rastrear mudanas no cdigo-fonte durante o desenvolvimento de software.</li>
<li>Projetado para coordenar o trabalho entre programadores, mas pode ser usado para rastrear mudanas em qualquer conjunto de arquivos.</li>
<li>Ele  um software livre e de cdigo aberto.</li>
<li>Ele foi criado por Linus Torvalds em 2005.</li>
</ul>
<footer>JAPEX</footer>
</section>

<header>Git e GitHub</header>
<h1 id="o-que-%C3%A9-github">O que  GitHub?</h1>
<ul>
<li>GitHub  uma plataforma de hospedagem de cdigo-fonte e arquivos baseado no Git.</li>
<li>Ele permite que voc e outras pessoas trabalhem juntas em projetos de qualquer lugar.</li>
<li>Ele foi criado por Tom Preston-Werner, Chris Wanstrath, e PJ Hyett em 2008.</li>
<li>Ele foi adquirido pela Microsoft em 2018.</li>
<li>Ele  um servio pago, mas tambm oferece planos gratuitos.</li>
</ul>
<footer>JAPEX</footer>
</section>

<header>Git e GitHub</header>
<h1 id="como-funciona-o-git">Como funciona o Git?</h1>
<ul>
<li>Armazena os arquivos em um repositrio.</li>
<li>Trata seus arquivos como um conjunto de imagens.</li>
<li>O Git tira uma "foto" de cada arquivo e armazena uma referncia para essa "foto".</li>
<li>Se o arquivo no foi alterado, o Git no tira outra "foto".</li>
<li>Funciona como um fluxo do estado dos arquivos.</li>
</ul>

<h1 id="como-funciona-o-git-2">Como funciona o Git?</h1>
<h2 id="%C3%A1reas-de-trabalho-do-git">reas de Trabalho do Git</h2>
<ul>
<li><strong><em>Working Directory</em></strong>:  onde voc trabalha nos arquivos.</li>
<li><strong><em>Staging Area</em></strong>:  onde voc prepara os arquivos para serem commitados.</li>
<li><strong><em>Repository</em></strong>:  onde o Git armazena os arquivos e o histrico de alteraes.</li>
</ul>

<header>Git e GitHub</header>
<h1 id="git---comandos-b%C3%A1sicos">Git - Comandos Bsicos</h1>
<ul>
<li><code>git init</code>: Inicializa um repositrio Git.</li>
<li><code>git add &lt;arquivo&gt;</code>: Adiciona um arquivo ao repositrio.</li>
<li><code>git add .</code>: Adiciona todos os arquivos ao repositrio.</li>
<li><code>git commit -m "Mensagem"</code>: Faz um commit com uma mensagem.</li>
<li><code>git status</code>: Verifica o status do repositrio.</li>
<li><code>git log</code>: Mostra o histrico de commits.</li>
<li><code>git diff</code>: Mostra as diferenas entre arquivos.</li>
</ul>
<footer>JAPEX</footer>
</section>
</foreignObject></svg><svg data-marpit-svg="" viewBox="0 0 1280 720"><foreignObject width="1280" height="720"><section id="19" data-header="Git e GitHub" data-footer="JAPEX" data-paginate="true" data-theme="default" lang="pt-BR" data-marpit-pagination="19" style="--header:Git e GitHub;--footer:JAPEX;--paginate:true;--theme:default;" data-marpit-pagination-total="39" data-transition-back="{&quot;name&quot;:&quot;fade&quot;,&quot;duration&quot;:&quot;0.3s&quot;,&quot;builtinFallback&quot;:true}" data-transition="{&quot;name&quot;:&quot;fade&quot;,&quot;duration&quot;:&quot;0.3s&quot;,&quot;builtinFallback&quot;:true}">
<header>Git e GitHub</header>
<h1 id="m%C3%A3o-na-massa---git">Mo na Massa - Git</h1>
<footer>JAPEX</footer>
</section>
</foreignObject></svg><svg data-marpit-svg="" viewBox="0 0 1280 720"><foreignObject width="1280" height="720"><section id="20" data-header="Git e GitHub" data-footer="JAPEX" data-paginate="true" data-theme="default" lang="pt-BR" data-marpit-pagination="20" style="--header:Git e GitHub;--footer:JAPEX;--paginate:true;--theme:default;" data-marpit-pagination-total="39" data-transition-back="{&quot;name&quot;:&quot;fade&quot;,&quot;duration&quot;:&quot;0.3s&quot;,&quot;builtinFallback&quot;:true}" data-transition="{&quot;name&quot;:&quot;fade&quot;,&quot;duration&quot;:&quot;0.3s&quot;,&quot;builtinFallback&quot;:true}">
<header>Git e GitHub</header>
<h1 id="m%C3%A3o-na-massa---git---instala%C3%A7%C3%A3o">Mo na Massa - Git - Instalao</h1>
<h2 id="instala%C3%A7%C3%A3o">Instalao</h2>
<ul>
<li>Instalar o Git: <a href="https://git-scm.com/">https://git-scm.com/</a>
<ul>
<li>Windows: Download do instalador e executar.</li>
<li>Linux: Utilizar o gerenciador de pacotes.
<ul>
<li>Debian/Ubuntu: <code>sudo apt install git</code></li>
</ul>
</li>
<li>MacOS: Utilizar o Homebrew.
<ul>
<li><code>brew install git</code></li>
</ul>
</li>
</ul>
</li>
</ul>
<footer>JAPEX</footer>
</section>
</foreignObject></svg><svg data-marpit-svg="" viewBox="0 0 1280 720"><foreignObject width="1280" height="720"><section id="21" data-header="Git e GitHub" data-footer="JAPEX" data-paginate="true" data-theme="default" lang="pt-BR" data-marpit-pagination="21" style="--header:Git e GitHub;--footer:JAPEX;--paginate:true;--theme:default;" data-marpit-pagination-total="39" data-transition-back="{&quot;name&quot;:&quot;fade&quot;,&quot;duration&quot;:&quot;0.3s&quot;,&quot;builtinFallback&quot;:true}" data-transition="{&quot;name&quot;:&quot;fade&quot;,&quot;duration&quot;:&quot;0.3s&quot;,&quot;builtinFallback&quot;:true}">
<header>Git e GitHub</header>
<h1 id="m%C3%A3o-na-massa---git-1">Mo na Massa - Git</h1>
<h2 id="instala%C3%A7%C3%A3o-1">Instalao</h2>
<ul>
<li>
<p>Verificar a instalao:</p>
<pre is="marp-pre" data-auto-scaling="downscale-only"><code class="language-bash">git --version
</code></pre>
</li>
<li>
<p>Criar uma conta no GitHub: <a href="https://github.com/signup">https://github.com/signup</a></p>
</li>
</ul>
<footer>JAPEX</footer>
</section>
</foreignObject></svg><svg data-marpit-svg="" viewBox="0 0 1280 720"><foreignObject width="1280" height="720"><section id="22" data-header="Git e GitHub" data-footer="JAPEX" data-paginate="true" data-theme="default" lang="pt-BR" data-marpit-pagination="22" style="--header:Git e GitHub;--footer:JAPEX;--paginate:true;--theme:default;" data-marpit-pagination-total="39" data-transition-back="{&quot;name&quot;:&quot;fade&quot;,&quot;duration&quot;:&quot;0.3s&quot;,&quot;builtinFallback&quot;:true}" data-transition="{&quot;name&quot;:&quot;fade&quot;,&quot;duration&quot;:&quot;0.3s&quot;,&quot;builtinFallback&quot;:true}">
<header>Git e GitHub</header>
<h1 id="m%C3%A3o-na-massa---git-2">Mo na massa - Git</h1>
<h2 id="configura%C3%A7%C3%A3o-inicial">Configurao Inicial</h2>
<p>Utilizando o terminal, execute os seguintes comandos:</p>
<pre is="marp-pre" data-auto-scaling="downscale-only"><code class="language-bash">git config --global user.name <span class="hljs-string">"Fulano de Tal"</span>
git config --global user.email <span class="hljs-string">"fulanotal@email.com"</span>
</code></pre>
<ul>
<li>
<p>Verificar a configurao:</p>
<pre is="marp-pre" data-auto-scaling="downscale-only"><code class="language-bash">git config --global --list
git config user.name
</code></pre>
</li>
</ul>
<footer>JAPEX</footer>
</section>
</foreignObject></svg><svg data-marpit-svg="" viewBox="0 0 1280 720"><foreignObject width="1280" height="720"><section id="23" data-header="Git e GitHub" data-footer="JAPEX" data-paginate="true" data-theme="default" lang="pt-BR" data-marpit-pagination="23" style="--header:Git e GitHub;--footer:JAPEX;--paginate:true;--theme:default;" data-marpit-pagination-total="39" data-transition-back="{&quot;name&quot;:&quot;fade&quot;,&quot;duration&quot;:&quot;0.3s&quot;,&quot;builtinFallback&quot;:true}" data-transition="{&quot;name&quot;:&quot;fade&quot;,&quot;duration&quot;:&quot;0.3s&quot;,&quot;builtinFallback&quot;:true}">
<header>Git e GitHub</header>
<h1 id="m%C3%A3o-na-massa---git-3">Mo na massa - Git</h1>
<ul>
<li>
<p>Criando um Diretrio:</p>
<pre is="marp-pre" data-auto-scaling="downscale-only"><code class="language-bash"><span class="hljs-built_in">mkdir</span> -pv /projeto/git_github &amp;&amp; <span class="hljs-built_in">cd</span> /projeto/git_github
</code></pre>
</li>
<li>
<p>Criar um repositrio:</p>
<pre is="marp-pre" data-auto-scaling="downscale-only"><code class="language-bash"> git init
</code></pre>
</li>
<li>
<p>Verificar status do repositrio:</p>
<pre is="marp-pre" data-auto-scaling="downscale-only"><code class="language-bash">git status
</code></pre>
</li>
</ul>
<footer>JAPEX</footer>
</section>
</foreignObject></svg><svg data-marpit-svg="" viewBox="0 0 1280 720"><foreignObject width="1280" height="720"><section id="24" data-header="Git e GitHub" data-footer="JAPEX" data-paginate="true" data-theme="default" lang="pt-BR" data-marpit-pagination="24" style="--header:Git e GitHub;--footer:JAPEX;--paginate:true;--theme:default;" data-marpit-pagination-total="39" data-transition-back="{&quot;name&quot;:&quot;fade&quot;,&quot;duration&quot;:&quot;0.3s&quot;,&quot;builtinFallback&quot;:true}" data-transition="{&quot;name&quot;:&quot;fade&quot;,&quot;duration&quot;:&quot;0.3s&quot;,&quot;builtinFallback&quot;:true}">
<header>Git e GitHub</header>
<h1 id="m%C3%A3o-na-massa---git-4">Mo na massa - Git</h1>
<ul>
<li>
<p>Adicionar arquivos ao repositrio:</p>
<pre is="marp-pre" data-auto-scaling="downscale-only"><code class="language-bash">git add .
</code></pre>
</li>
<li>
<p>Fazer um commit:</p>
<pre is="marp-pre" data-auto-scaling="downscale-only"><code class="language-bash"> git commit -m <span class="hljs-string">"Primeiro commit"</span>
</code></pre>
</li>
<li>
<p>Verificar histrico de commits:</p>
<pre is="marp-pre" data-auto-scaling="downscale-only"><code class="language-bash"> git <span class="hljs-built_in">log</span>
</code></pre>
</li>
</ul>

<h1 id="git---gitignore">Git - Gitignore</h1>
<ul>
<li>O arquivo <code>.gitignore</code>  um arquivo de configurao do Git.</li>
<li>Ele permite que voc especifique arquivos e diretrios que o Git deve ignorar.</li>
<li>Ele  til para ignorar arquivos temporrios, arquivos de compilao, arquivos de log, etc.</li>
<li>Ele  um arquivo de texto simples.</li>
</ul>
